function exchange(){return this.users=(e=>fetch("https://us-central1-astra-exchange.cloudfunctions.net/users").then(a=>a.json().then(a=>e(a)))),this.transact=((e,a,t,n,s,r,c)=>fetch(`https://cors-anywhere.herokuapp.com/https://us-central1-astra-exchange.cloudfunctions.net/transact?pin=${e}&from=${a}&to=${t}&amount=${n}${s?`&message=${s}`:""}`).then(e=>{switch(e.status){case 200:r();break;case 400:c(400,"Invalid parameters");break;case 404:c(404,"Invalid user ID");break;case 403:c(403,"Insufficient balance");break;case 401:c(401,"Invalid pin");break;default:c(500,"Unknown error. Please try again")}})),this.userWithId=((e,a,t,n)=>fetch(`https://cors-anywhere.herokuapp.com/https://us-central1-astra-exchange.cloudfunctions.net/user?id=${e}${a?`&pin=${a}`:""}`).then(e=>{switch(e.status){case 200:return e.json().then(e=>t(e));case 400:n(400,"Invalid parameters");break;case 404:n(404,"Invalid user ID");break;case 401:n(401,"Invalid pin");break;default:n(500,"Unknown error. Please try again")}})),this.userWithEmail=((e,a,t,n)=>fetch(`https://cors-anywhere.herokuapp.com/https://us-central1-astra-exchange.cloudfunctions.net/user?email=${e}${a?`&pin=${a}`:""}`).then(e=>{switch(e.status){case 200:return e.json().then(e=>t(e));case 400:n(400,"Invalid parameters");break;case 404:n(404,"Invalid email");break;case 401:n(401,"Invalid pin");break;default:n(500,"Unknown error. Please try again")}})),this.transactions=((e,a,t,n)=>fetch(`https://cors-anywhere.herokuapp.com/https://us-central1-astra-exchange.cloudfunctions.net/transactions?id=${e}&pin=${a}`).then(e=>{switch(e.status){case 200:return e.json().then(e=>t(e));case 400:n(400,"Invalid parameters");break;case 404:n(404,"Invalid user ID");break;case 401:n(401,"Invalid pin");break;default:n(500,"Unknown error. Please try again")}})),this}